import csv# Initialiser lister for den første filentidspunkt1 = []temperatur1 = []# Initialiser lister for den andre filentidspunkt2 = []trykk2 = []# Les den første filenwith open('/Users/ingridellingsen/Library/Mobile Documents/com~apple~CloudDocs/EKSAMNER /DAT120/Gruppeoppgave del 1/trykk_og_temperaturlogg_rune_time.csv.txt', mode='r') as fil1:    reader = csv.reader(fil1, delimiter=";")    next(reader)  # Hopp over header-raden    for row in reader:        tidspunkt1.append(row[0])  # Tilpass datatype etter behov        try:            temperatur1.append(float(row[1]))        except ValueError:            print(f"Ugyldig temperaturverdi i rad: {row}")        # Les den andre filenwith open('/Users/ingridellingsen/Library/Mobile Documents/com~apple~CloudDocs/EKSAMNER /DAT120/Gruppeoppgave del 1/temperatur_trykk_met_samme_rune_time_datasett.csv.txt', mode='r') as fil2:    reader = csv.reader(fil2, delimiter=";")    next(reader)  # Hopp over header-raden    for row in reader:        tidspunkt2.append(row[0])        try:            trykk2.append(float(row[1]))        except ValueError:            print(f"Ugyldig trykkverdi i rad: {row}")            # Test utskrift for å sjekke at dataene er lastet inn riktigprint(f"Første fil - Tidspunkt: {tidspunkt1}, Temperatur: {temperatur1}")print(f"Andre fil - Tidspunkt: {tidspunkt2}, Trykk: {trykk2}")